Biografia:
Red Letter Day has been the name of at least eight different bands:  

1. A punk band from the Portsmouth region of the UK; 

2. a folk/blues band from the Eastern US that consisted of Suzanna Mallow and Andrea Jones (and does not appear to be recording any longer); 

3. a hard rock band from the Virginia region of the US that mostly performs live. 

4. A pop band from Hamburg, Germany, 1989-1994. 

5. A  punk rock band from South Florida comprised of ex-members of As Friends Rust, before they became The Rocking Horse Winner. <a href="https://www.last.fm/music/Red+Letter+Day">Read more on Last.fm</a>
